import React from "react";
import {FooterBox} from "./styles";

const Footer = () => {
        return (
            <FooterBox>
                <a href="https://reqres.in" target="_blank" rel="noopener noreferrer"></a>
            </FooterBox>
        );
}
export default Footer;
